import { StyleSheet } from 'react-native';

const general = (props) => StyleSheet.create({

});
const home = StyleSheet.create({

    sidebar: {
        position: "fixed",
        right: 0,
        top: 0,
        margin: 20,
        aspectRatio: '1 / 1',
        justifyContent: "center",
        alignItems: "center",
    },

    sidebarIcon: {
        height: 50,
        width: 50,
    },

    mainInfograph: {
        flexWrap: "wrap",
        // width: vw,
        aspectRatio: "1 / 1",
    },

    mainInfographContent: {
        flex: 1,
        backgroundColor: "rgba(255, 255, 255, 0.6)",
        margin: 20,
        borderRadius: 15,
        justifyContent: "center",
        alignItems: "center",
    },

    subContent: {
        flexDirection: "row",
        width: "100%",
    },

    infographAnalysis: {
        flex: 1.5,
        flexWrap: "wrap",
        backgroundColor: "rgba(255, 255, 255, 0.6)",
        aspectRatio: '1 / 1',
        margin: 20,
        marginRight: 10,
        marginTop: 0,
        borderRadius: 15,
        padding: 20,
        flexDirection: "row",
    },

    infographAnalysisTitle: {
        margin: 10,
        marginLeft: 0,
        marginTop: 0,
    },

    inputData: {
        flex: 1,
        backgroundColor: "rgba(255, 255, 255, 0.8)",
        flexWrap: "wrap",
        margin: 20,
        marginLeft: 10,
        marginTop: 0,
        borderRadius: 15,
        padding: 10,
    },

    bloodPressure: {
        // width: vw,
        flexWrap: "wrap",
    },

    bloodPressureContent: {
        margin: 20,
        marginTop: 0,
        padding: 20,
        backgroundColor: "rgba(255, 255, 255, 0.8)",
        borderRadius: 15,
        // height: vw * .4, //!subject to change
    },
});

const bloodSugarGraph = StyleSheet.create({
    high: {
        color: "#E24D50",
        fontFamily: "Arboria-Medium",
    },

    midHigh: {
        color: "#FFA26F",
        fontFamily: "Arboria-Medium",
    },

    normal: {
        color: "#38B346",
        fontFamily: "Arboria-Medium",
    },

    low: {
        color: "#3295EF",
        fontFamily: "Arboria-Medium",
    }
});

export { general, home, bloodSugarGraph }
